	('2025-06-26 00:46:48.216314+00', 'SetupTeardown Alert Fix', 'Get rid of alert when teardown and setup are overlapping by just one day.', 'ceaef02a-7f0e-46a2-bdac-bc2999e0de34', '236d435a-6e37-4b93-88ab-00be22b36a90', '522a8854-a705-4d85-b13b-3811abd0350c', 'fb847f63-6088-4089-b62f-fe4aa4abe573'),
	('2025-08-06 17:14:34.410444+00', 'Laggy only in yellow boxes', 'when typing in yellow boxes sometimes the text can take like 8 seconds to update.', '8e24e3f4-a443-4792-a89d-123924c48321', '236d435a-6e37-4b93-88ab-00be22b36a90', '80209027-1a94-4496-a808-da0217e7fcf5', 'fb847f63-6088-4089-b62f-fe4aa4abe573'),
	('2025-06-26 00:43:36.324324+00', 'Roadmap', 'Add Features Log. Add a button to the top right by the bell called “Request Feature” This could be a google form or document if its possible but it could also be a fully coded page. It should allow users to create a new feature request, label them as a feature or a bug, track who submitted the request. Then if they get approved we can see the actual roadmap and update the roadmap whenever.', 'b72e218f-6a71-4259-9403-c1226a47db90', '236d435a-6e37-4b93-88ab-00be22b36a90', '013b8a77-6599-4aea-a460-bfa03458460f', 'fb847f63-6088-4089-b62f-fe4aa4abe573'),
	('2025-06-26 00:48:01.885869+00', 'User Permissions Bug', 'When a user first creates an account it turns them into an account manager if they were an admin. Do capitals in the email do weird things?', '8e24e3f4-a443-4792-a89d-123924c48321', '35e4808d-a206-4887-94c2-8ccc9f13264a', '0e494d61-b91a-4e77-8d43-a58069fcc22e', 'fb847f63-6088-4089-b62f-fe4aa4abe573'),
	('2025-06-26 00:46:24.468119+00', 'Bleacher Location', 'Beside the bleacher number, put the city(first) and province/state(second). Also add an address field to the teardown and white space block so the bleacher location can use it. The bleacher location logic should be to find today and look left to find the last address. This is where the bleacher should be. If it''s currently in an event, then use this address.', 'b72e218f-6a71-4259-9403-c1226a47db90', '236d435a-6e37-4b93-88ab-00be22b36a90', '86be6f98-4969-4a2b-8f3b-553c1b308a4a', 'fb847f63-6088-4089-b62f-fe4aa4abe573'),
	('2025-06-26 00:45:33.918833+00', 'Bleacher Colours', 'Bring back the coloured labels for bleacher dashboard', 'b72e218f-6a71-4259-9403-c1226a47db90', '236d435a-6e37-4b93-88ab-00be22b36a90', '31afea78-df37-4c83-b68a-e2d71d2ad126', 'fb847f63-6088-4089-b62f-fe4aa4abe573'),
	('2025-06-26 00:44:44.196943+00', 'Remove Home Base Rule', 'Remove Rule stating events must be within a home base.
